import React from "react";
import { Outlet } from "react-router-dom";
import AdminSideBar from "./AdminSideBar";

const AdminLayout = () => {
  return (
    <>
      <AdminSideBar />
      <Outlet />
    </>
  );
};

export default AdminLayout;
